public void storePhysician(RecId _recId)
{
    if (isOrderingPhysician)
    {
        orderingProviderRecId = _recId;
        HMInsuranceCarrier.HMOrderingProvider = orderingProviderRecId;
    }
    else
    {
        supervisingProviderRecId = _recId;
        HMInsuranceCarrier.HMSupervisingProvider = supervisingProviderRecId;
    }
}

public void updateEDIAgreementCheckbox()
{
    if(HMInsuranceCarrier.IsEDIAgreementRequired == NoYes::No)
    {
        HMInsuranceCarrier_ds.object(fieldNum(HMInsuranceCarrier, EDIAgreementApproved)).allowEdit(false);
        HMInsuranceCarrier.EDIAgreementApproved = NoYes::No;
    }
    else if (HMInsuranceCarrier.IsEDIAgreementRequired == NoYes::Yes)
    {
        HMInsuranceCarrier_ds.object(fieldNum(HMInsuranceCarrier, EDIAgreementApproved)).allowEdit(true);
    }

}

public void executeQuery()
{
     Args args;
     QueryBuildRange qr;
    HMPatientInsurance _HMPatientInsurance;
    HMResourceSchedulingAppointment _HMResourceSchedulingAppointmentDS;

    if(element.args().record())
    {
    _HMResourceSchedulingAppointmentDS         = HMResourceSchedulingAppointment::find(element.args().record().RecId);
    if( _HMResourceSchedulingAppointmentDS)
    {
        select *from _HMPatientInsurance where _HMPatientInsurance.RecId== _HMResourceSchedulingAppointmentDS.HMPatientInsurance;
        if(_HMPatientInsurance)
        {
             this.query().dataSourceTable(tableNum (HMInsuranceCarrier)).addRange(fieldNum(HMInsuranceCarrier,Code)).value(_HMPatientInsurance.InsuranceCarrier);

        }
    }
    }
    super();
}

