public void init()
{
    super();
    this.queryBuildDataSource().clearRanges();
    if(element.args().menuItemName() == menuitemDisplayStr(HMCorporateCarrier))
    {
        this.query().dataSourceTable(tableNum(CustTable)).addRange(fieldNum(CustTable,CustType)).value(SysQuery::value(CustType::Corporate));
    }
    else if (element.args().menuItemName() == menuitemDisplayStr(HMClientAccount))
    {
        this.query().dataSourceTable(tableNum(CustTable)).addRange(fieldNum(CustTable,CustType)).value(SysQuery::value(CustType::Client));
    }
    else
    {
        this.query().dataSourceTable(tableNum(CustTable)).addRange(fieldNum(CustTable,CustType)).value(SysQuery::value(CustType::Insurance));
    }
}

public void write()
{
    DirPartyTable party;

    //super();
    if(CustTable.isNewRecord())
    {
        CustTable.insert(DirPartyType::Organization);
    }
    else
    {
        CustTable.update();
    }

    ttsBegin;
    select forUpdate party where party.RecId == CustTable.Party;
    party.Name = HMInsuranceCarrier.Name;
    party.update();
    ttsCommit;
}

