public void updateButtons()
{
    boolean mainExist,exist;

    mainExist = (HMInsuranceCarrier.RecId != 0);
    exist = (DirPartyPostalAddressView.RecId != 0);

    editAddress.enabled(exist);
    detailAddress.enabled(mainExist);
    deleteAddress.enabled(hasTableAccess(tableNum(LogisticsLocation), AccessType::Delete) && exist && DirPartyPostalAddressView.IsPrimary == false);
    deactivateAddress.enabled(exist && DirPartyPostalAddressView.IsPrimary == false);
}

